import { useMutation } from "react-query"
import { userApi } from "../../../service/userApi"

export const useFindOneUser = () => {
    const { mutateAsync: findOneUser } = useMutation('user', (params: { email: string, phone: string }) => userApi.findOneUser(params.email, params.phone), {
        onSuccess: () => {

          alert('User Saved Successfully')
        },

        onError: (error: any) => {
          alert(error)

        },
      })
      return {findOneUser}
    }
